const Navbar = () => {
    return (
      <nav className="navbar">
        <h1>Middlebury Climbing Club</h1>
        <div className="links">
            <div class="dropdown">
                <button class="dropbtn">Midd Gap</button>
                <div class="dropdown-content">
                    <a href="/MiddGap">About</a>
                    <a href="/RoadsideBoulders">Roadside Boulders</a>
                    <a href="/HPBoulders">Harry Potter Boulders</a>
                </div>
            </div>
            <a href="/ClimbingClub">Middlebury Climbing Club</a>
        </div>
      </nav>
    );
  }

  export default Navbar;
